import React from 'react';
import { useQRCode } from 'react-hook-qrcode';

const PaymentPage = () => {
    const [inputRef] = useQRCode({
        text: 'https://google.com',
        options: {
            level: 'S',
            margin: 7,
            scale: 1,
            width: 400,
        },
    });

    const back = () => {
        navigate(-1);
      };

    return (
        <div>
            <canvas ref={inputRef} />
            <button type="button" onClick={back}>
              戻る
            </button>
        </div>
    );
};

export default PaymentPage;
